import styled from "styled-components";
import tw from "twin.macro";
import "./storyList.css";

import 'react-slideshow-image/dist/styles.css'
import { Link } from "react-router-dom";
import { Slide } from 'react-slideshow-image';

const slideImages = [
  'https://www.wearable-technologies.com/wp-content/uploads/2018/10/Unity-ar-ads-1.png',
  'https://bevel.space/wp-content/uploads/2018/10/Bevel_Mobile_AR_header-crop.png',
  'https://cdn.shopify.com/s/files/1/1551/3581/files/AR_Room_Edited_02_large.jpg?v=1556729184',
  //'https://dynl.mktgcdn.com/p/4TZImYskTdK9zkIEkix4H3qhsKNgUVNMwDHszZPdUsI/619x412.jpg',
  //'https://images.ctfassets.net/8cd2csgvqd3m/6MtLXbfhaybi4ez8T534on/5f76e80aec5f10d13d0248aa50c9a8ec/XL.jpg',
  //'https://d3boo0lmrw6bqz.cloudfront.net/img/iws/iws_header.jpg'
];




const Container = styled.div`
  ${tw`
    m-10
    p-10
    bg-cover
    bg-no-repeat
  `};
`;


const Slideing = styled.div`
  ${tw`
    w-1/2

  `};
`;
const Contents = styled.div`
  ${tw`
  m-auto
`};
`;

const Text = styled.div`
  ${tw`
  text-3xl
  p-20
  text-white
  w-1/3
  text-left

`};
`;
function StoryList() {
    return (
        <main>



        <div>

          <Slide easing="ease">
            <div className="each-slide">
              <div style={{'backgroundImage': `url(${slideImages[0]})`}}>
                <Text >Experience the ultimate cinematic experience in your home</Text>

              </div>
            </div>
            <div className="each-slide">
              <div style={{'backgroundImage': `url(${slideImages[1]})`}}>
              </div>
            </div>
            <div className="each-slide">
              <div style={{'backgroundImage': `url(${slideImages[2]})`}}>
              </div>
            </div>
          </Slide>

        </div>




        <div class="grid grid-cols-10 grid-rows-10 ">

            <div class="col-start-1 col-span-6 row-start-1 row-span-2 ">
                <Link to={"/story1"} style = {{textDecoration: 'none'}}>

                    <Container
                          style={{
                          backgroundImage: `url("https://d3boo0lmrw6bqz.cloudfront.net/img/iws/iws_header.jpg")`,
                          }}
                    >
                        <Contents>
                        <Text >Click for party experience abc asdsa sdds ascsa scdwceccqscdwceccqxqxqwxqwwfveqcescdwceccqxqxqwxqwwfveqcescdwceccqxqxqwxqwwfveqce xqxqwxqwwfveqce  qwdqwdqwd qwdqwdq qwdqw </Text>
                        </Contents>
                    </Container>

                  </Link>
              </div>


            <div class="col-start-1 col-span-10 row-start-3 ">
                <Link to={"/products"} style = {{textDecoration: 'none'}}>
                <Container
                    style={{
                        backgroundImage: `url("https://images.ctfassets.net/8cd2csgvqd3m/6MtLXbfhaybi4ez8T534on/5f76e80aec5f10d13d0248aa50c9a8ec/XL.jpg")`,
                        }}
                        >
                  <Contents>
                  <Text >COME EXPERIENCE OUR PRODUCTS AR!</Text>
                  </Contents>
                  </Container>
                  </Link>
              </div>

              <div class="col-start-0 col-span-4 row-start-1 row-span-2">
                  <Link to={"/products"} style = {{textDecoration: 'none'}}>

                  <Container
                  style={{
                    backgroundImage: `url('https://www.esquireme.com/public/images/2019/05/20/esquire_bang-olufsen-bronze-collection-release-01.jpg')`,
                  }}
                  >
                  <Contents>
                  <Text>Experience the ultimate cinematic experience in your home</Text>
                  </Contents>
                  </Container>
                  </Link>
            </div>

        </div>




        </main>
    )
}


export default StoryList;
